import React from 'react'
import './styles/Page.css';
import ServicesPage from '../Assets/images/Отзывы.svg';

function Reviews() {
  return (
    <div className='abut-container'>
    <img
      src={ServicesPage} 
    />
</div>
  )
}

export default Reviews
